import React from 'react';

const Dashboard = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <h1>Dashboard</h1>
    </div>
  );
};

export default  Dashboard;
